/*
База данных для электронной библиотеки. Зарегистрированные пользователи могут читать или слушать любые книги, которые входят
в преобретенную подписку. Также есть большое количество книг, доступных бесплатно - без подписки. Каждая книга имеет свой рейтинг, 
любой пользователь может оценить книгу и оставить отзыв вне зависимоти от того, прочитана ли им книга на сайте. На основании выставленных оценок
пользователь получет персональные рекомендации, что мотивирует не терять интерес к сайту и преобретать подписку. Также на основании оценок и 
количества прочтений составляется рейтинг книг на сайте.
Существует три вида подписок: лайт, оптимум, премиум. Аудиокниги входят только в подписку премиум. 
Каждую из подписок можно преобрести на 1, на 3 месяца либо на год.
*/

DROP DATABASE IF EXISTS book_lib;
CREATE DATABASE book_lib;
USE book_lib;

-- виды подписок
DROP TABLE IF EXISTS subscriptions;
CREATE TABLE subscriptions (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255) UNIQUE 
);

INSERT INTO subscriptions (name) VALUES
	('light'),
	('optimum'),
	('premium');

-- тарифные планы подписок
DROP TABLE IF EXISTS subscription_plans;
CREATE TABLE subscription_plans (
	id SERIAL PRIMARY KEY,
	subscription_id BIGINT UNSIGNED NOT NULL,
	period VARCHAR(255),
	price DECIMAL(11,2),
	FOREIGN KEY (subscription_id) REFERENCES subscriptions(id)
);

INSERT INTO subscription_plans (subscription_id, period, price) VALUES
	('1', '1 month', '99'),
	('1', '3 months', '259'),
	('1', '1 year', '999'),
	('2', '1 month', '199'),
	('2', '3 months', '499'),
	('2', '1 year', '1999'),
	('3', '1 month', '399'),
	('3', '3 months', '999'),
	('3', '1 year', '3999');

-- пользователи
DROP TABLE IF EXISTS users;
CREATE TABLE users (
	id SERIAL PRIMARY KEY,
	firstname VARCHAR(50),
	lastname VARCHAR(50),
	email VARCHAR(120) UNIQUE NOT NULL,
	password_hash VARCHAR(100) NOT NULL,
	phone BIGINT,
	birthday DATE,
	photo_file VARCHAR(255),
	created_at DATETIME DEFAULT NOW() COMMENT 'дата создания аккаунта',
	subscription_plan_id BIGINT UNSIGNED, -- если NULL - без подписки
	subs_date DATETIME COMMENT 'дата оформления подписки', 
	INDEX users_firstname_lastname_idx (firstname, lastname),
	INDEX phone_idx (phone), -- создаю индекс на случай, если авторизация осуществляется по номеру телефона
	FOREIGN KEY (subscription_plan_id) REFERENCES subscription_plans(id) ON UPDATE CASCADE ON DELETE SET NULL 
);


