-- статистика чтения
DROP TABLE IF EXISTS users_stats;
CREATE TABLE users_stats (
	user_id SERIAL PRIMARY KEY,
	books_count BIGINT UNSIGNED COMMENT 'книг прочитано', -- книги, которые пользователь читал, не обязательно до конца
	total_pages BIGINT UNSIGNED COMMENT 'всего страниц прочитано',
	total_reading_time BIGINT UNSIGNED COMMENT 'все время за чтением в часах',
	pages_per_hour FLOAT(8,2) AS (total_pages / total_reading_time) STORED COMMENT 'скорость чтения, страниц в час',
	FOREIGN KEY (user_id) REFERENCES users(id) ON UPDATE CASCADE ON DELETE CASCADE 
);

