-- библиотека, бесплатные книги имеют subscription_id = null
DROP TABLE IF EXISTS books;
CREATE TABLE books (
	id SERIAL PRIMARY KEY,
	name VARCHAR(255),
	`type` ENUM ('book', 'audio'),
	publisher VARCHAR(255),
	publication_date DATE,
	translator VARCHAR(255),
	page_number INT,
	annotation TEXT,
	`size` INT,
	file VARCHAR(255),
	subscription_id BIGINT UNSIGNED,
	INDEX books_name_idx(name),
	INDEX books_publisher_idx(publisher),
	FOREIGN KEY (subscription_id) REFERENCES subscriptions (id) ON UPDATE CASCADE ON DELETE SET NULL 	
);


