-- корректирую данные, чтобы у аудиокниг была только премиум подписка
UPDATE books 
	SET 
		page_number = NULL 
	WHERE 
		`type` = 'audio';
UPDATE books 
	SET 
		subscription_id = 3 
	WHERE 
		`type` = 'audio';
	
-- таблица для связи авторов и книг, у автора может быть много книг и у книги может быть несколько авторов

DROP TABLE IF EXISTS books_authors;
CREATE TABLE books_authors (
	book_id BIGINT UNSIGNED NOT NULL,
	author_id BIGINT UNSIGNED NOT NULL,
	INDEX (book_id),
	INDEX (author_id),
	PRIMARY KEY (book_id, author_id),
	FOREIGN KEY (book_id) REFERENCES books(id) ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY (author_id) REFERENCES authors(id) ON UPDATE CASCADE ON DELETE CASCADE
);

